node.text:
In questo nuovo episodio di #unvegetarionaabarcelona (con tanto di foto di @manolisfringuellopolus) scopriamo che:
- i tre @restaurantesvegetalia sono sempre una buona idea per mangiare vegano (anche a tarda ora) a Barna, spendendo poco e mangiando tanto;
- @beyondmeat spopola ormai anche in Spagna, e ad un prezzo più accessibile che qui: da #Vegetalia, appunto, si può chiedere nel burger al posto della polpetta fatta in casa
- gazpacho e hummus non possono mai mancare;
- il #carmelitasmack mi si addice un casino
